import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const MainContent = (props) => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3
    };

    return (
        <div>
            <h3>{props.name}</h3>
            <h3>{props.age}</h3>
            <h3>{props.birthday}</h3>
            <Slider {...settings}>
                {props.img.map((image, index) => (
                    <div key={index}>
                        <img src={image} alt={`${props.name}-${index}`} />
                    </div>
                ))}
            </Slider>
        </div>
    )
}

export default MainContent;
